import {reject} from 'lodash'

const CUSTOM_OPTIONS = [
  'warehouse_zipcode',
  'warehouse_state',
  'warehouse_city',
  'warehouse_address',
  'taxable_states',
]

export default {
  template: require('./template'),

  computed: {
    common_options() {return reject(this.$options.options, (o) => CUSTOM_OPTIONS.indexOf(o) >=0)}
  }
}
